import React from "react";
import { BrowserRouter as Router, Link } from "react-router-dom";
import "./styles.css";
import Git_Logo from "./imgs/Git_Logo.svg";
import LinkedIn_Logo from "./imgs/LinkedIn_Logo.svg";
import Profile_Logo from "./imgs/Profile_Logo.svg";
import Resume from "./resume_webdev.pdf"
import About from "./About.js"



export default function NAV() {
  return (
    <div className="NAV">
      <Link to="https://www.linkedin.com/in/charlie-yi-2002/">
        <img src={LinkedIn_Logo} alt="LinkedIn" />
      </Link>
      <Link to="https://github.com/CharlieYi2002">
        <img src={Git_Logo} alt="Github Logo" />
      </Link>
      <Link to={Resume}>
        <img src={Profile_Logo} alt="Resume" />
      </Link>
      <Link to="/">About</Link>
      {/* <Link to="/Games">Games</Link> */}
    </div>
  );
}
